    "historical_p1" : {
        "eng" : "To promote the tourism potential of Navoi region, to increase the flow of tourists and create a positive image of the region by using the huge tourism potential of the regions more fully and effectively, measures are being implemented step by step by the Tourism Development Department of Navoi region.",
        "rus" : "Для продвижения туристического потенциала Навоийской области, увеличения потока туристов и создания положительного имиджа области путем более полного и эффективного использования огромного туристического потенциала регионов, Департаментом развития туризма поэтапно реализуются меры. Навоийская область.",
        "uzb" : "Navoiy viloyatining turizm salohiyatini targʻib qilish, hududlarning ulkan turizm salohiyatidan yana-da toʻliq va samarali foydalangan holda turistlar oqimini koʻpaytirish va viloyatning ijobiy qiyofasini shakllantirish borasida Navoiy viloyat Turizmni rivojlantirish boshqarmasi tomonidan chora-tadbirlar bosqichma bosqich amalga oshirilmoqda." 
    },
    "historical_p2" : {
        "eng" : "In order to ensure the fulfillment of these tasks, a bilateral agreement with the total cost of the project of 1100.0 million soums was signed between the regional tourism development department and the Central Asian Institute of International Studies (IICAI) on May 20, 2019, to include the above-mentioned historical monuments in the UNESCO list. signed.",
        "rus" : "В целях обеспечения выполнения данных задач 20 мая 2019 года между региональным отделом развития туризма и Центральноазиатским институтом международных исследований (МИЦАИ) было подписано двустороннее соглашение общей стоимостью проекта 1100,0 млн. сум, в включить вышеуказанные исторические памятники в список ЮНЕСКО.",
        "uzb" : "Mazkur vazifalar ijrosini taʼminlash maqsadida, yuqorida nomi koʻrsatib oʻtilgan tarixiy yodgorliklarni, YUNESKO roʻyxatiga kiritish boʻyicha 2019-yil 20-may kuni viloyat Turizmni rivojlantirish hududiy boshqarmasi va Oʻrta Osiyo Xalqaro tadqiqotlar instituti (IICAI) oʻrtasida loyihaning umumiy qiymati 1100,0 mln soʻmlik ikki tomonlama shartnoma imzolandi." 
    },
