    "log_head1" : {
        "eng" : "Logistics is the correct management of information, material and human flows, in a narrow sense - the minimization of costs and the optimization of the delivery time of materials and human resources. The concept includes a methodology for developing optimal rational methods for managing such flows.",
        "rus" : "Логистика – это правильное управление информационными, материальными и человеческими потоками, в узком смысле – минимизация затрат и оптимизация сроков доставки материалов и человеческих ресурсов. Концепция включает методологию разработки оптимальных рациональных методов управления такими потоками.",
        "uzb" : "Logistika - axborot, materiallar va inson oqimlarini to'g'ri boshqarish, dar ma'noda - xarajatlarni minimallashtirish va materiallar va inson resurslarini etkazib berish muddatini optimallashtirishdir. Kontseptsiyada bunday oqimlarni boshqarish uchun optimal ratsional usullarni ishlab chiqish uchun metodologiya mavjud." 
    },
    "log_head2" : {
        "eng" : "The logistician is responsible for organizing the delivery of certain goods from point A to point A with minimal waste and delivery time, taking into account the interests of the customer, manufacturer, seller, and drivers.",
        "rus" : "Логист отвечает за организацию доставки определенного товара из точки А в точку А с минимальными отходами и сроками доставки, с учетом интересов заказчика, производителя, продавца, водителей.",
        "uzb" : "Lojistikchi - A nuqtadan A nuqtasiga qadar ma'lum tovarlarni yetkazib berishning minimal chiqindilari va yetkazib berish vaqtini etkazib berishni tashkil qilishdan iborat bo'lib, mijozning, ishlab chiqaruvchining, sotuvchining, haydovchilarning manfaatlarini inobatga olgan holda ishlaydi." 
    },
    "log_head3" : {
        "eng" : "Part of transportation is cargo logistics; organization of regular deliveries without warehouses, here the main purpose of logistics is manifested. Here, the main concept is the cargo division, that is, a certain amount of the product is considered as an indivisible commodity.",
        "rus" : "Частью перевозки является грузовая логистика; организация регулярных поставок без складов, здесь проявляется основное назначение логистики. Здесь основным понятием является деление груза, то есть определенное количество товара рассматривается как неделимый товар.",
        "uzb" : "Transportning bir qismi yuk logistikasi; omborlarsiz muntazam yetkazib berishni tashkil etish, bu erda logistikaning asosiy maqsadi namoyon bo'ladi. Bu erda asosiy tushunchaning yuk bo'linmasi, ya'ni mahsulotning muayyan miqdori bo'linmas bir tovar sifatida qaraladi." 
    },
    "log_head4" : {
        "eng" : "The essence of logistics supply is to ensure the process of movement of raw materials. In the process of providing the company with material resources, it is necessary to competently manage material flows: to understand who should be bought, under what conditions, and how much. The following tasks should be solved during the procurement process.",
        "rus" : "Суть логистического снабжения заключается в обеспечении процесса движения сырья. В процессе обеспечения предприятия материальными ресурсами необходимо грамотно управлять материальными потоками: понимать, кого покупать, на каких условиях и в каком количестве. В процессе закупок должны быть решены следующие задачи.",
        "uzb" : "Logistika ta'minotining mohiyati xom ashyoning harakatlanish jarayonini ta'minlashdan iborat. Kompaniyani moddiy resurslar bilan ta'minlash jarayonida moddiy oqimlarni malakali boshqarish kerak: tushunish uchun, kimni, qanday sharoitda, qancha sotib olish kerak. Xaridlar jarayonida quyidagi vazifalar hal etilishi kerak." 
    },
