    "constitution_text" : {
        "eng" : "Our Constitution, adopted at the XI session of the Supreme Council of the Republic of Uzbekistan of the XII convocation on December 8, 1992, serves as the legal foundation for building a legal-democratic state and building a free civil society in our country. Constitution of the Republic of Uzbekistan, Section 6, Chapter 26, It consists of 128 articles, which define the main principles of the legal and democratic development of our country. The recognition of our constitution by international organizations and experts increases and strengthens the prestige of our country in the world community. In a word, our General Council serves as a solid legal foundation for 'transition from a strong state to a strong civil society'. Uzstandart agency and its system-organizations organized roundtable discussions and seminars on this date. is being done.",
        "rus" : "Наша Конституция, принятая на XI сессии Верховного Совета Республики Узбекистан XII созыва 8 декабря 1992 года, служит правовой основой построения правового демократического государства и построения свободного гражданского общества в нашей стране. Республики Узбекистан, раздел 6, глава 26, состоит из 128 статей, в которых определены основные принципы правового и демократического развития нашей страны.Признание нашей конституции международными организациями и экспертами повышает и укрепляет престиж нашей страна в мировом сообществе. Одним словом, наш Генеральный совет служит прочной правовой основой «перехода от сильного государства к сильному гражданскому обществу».К этой дате агентство «Узстандарт» и его системные организации организовали круглые столы и семинары.",
        "uzb" : "1992 yil 8 dekabrda XII chaqiriq O‘zbekiston Respublikasi Oliy Kengashining XI sessiyasida qabul qilingan Konstitutsiyamiz mamlakatimizda huquqiy-demokratik davlat qurish va erkin fuqarolik jamiyatini barpo etishning huquqiy poydevori bo‘lib xizmat qilmoqda.O‘zbekiston Respublikasi Konstitutsiyasi 6 bo‘lim, 26 bob, 128 moddadan iborat bo‘lib, unda mamlakatimizning huquqiy, demokratik jihatdan rivojlantirishning asosiy prinsiplari belgilangan.Konstitutsiyamiz xalqaro tashkilotlar va ekspertlar tomonidan e’tirof etilganligi esa davlatimizning dunyo hamjamiyatidagi nufuzini oshirmoqda va mustahkamlamoqda. Bir so‘z bilan aytganda, Bosh Qomusimiz 'Kuchli davlatdan - kuchli fuqarolik jamiyatiga o‘tish'ning mustahkam huquqiy poydevori bo‘lib xizmat qilmoqda.“O‘zstandart” agentligi va uning tizim-tashkilotlarida mazkur sana munosabati bilan davra suhbatlari va seminarlar tashkil etilmoqda."
    },
